import React from 'react';
import { Play, Edit2, Trash2, Users, CheckCircle, Clock, AlertCircle } from 'lucide-react';
import './ProjectCard.css';

const ProjectCard = ({ project, onRun, onEdit, onDelete, onClick }) => {
  const getStatusIcon = () => {
    switch (project.status) {
      case 'completed':
        return <CheckCircle size={16} className="status-icon completed" />;
      case 'running':
        return <Clock size={16} className="status-icon running" />;
      case 'failed':
        return <AlertCircle size={16} className="status-icon failed" />;
      default:
        return null;
    }
  };

  const getStatusLabel = () => {
    switch (project.status) {
      case 'draft':
        return 'Draft';
      case 'running':
        return 'Running';
      case 'completed':
        return 'Completed';
      case 'failed':
        return 'Failed';
      case 'pending_checkpoint':
        return 'Pending Approval';
      default:
        return 'Unknown';
    }
  };

  const formatDate = (dateString) => {
    const date = new Date(dateString);
    return date.toLocaleDateString('en-US', {
      month: 'short',
      day: 'numeric',
      year: 'numeric'
    });
  };

  const totalAgents = project.teams.reduce((sum, team) => sum + team.agents.length, 0);

  return (
    <div className="project-card" onClick={onClick}>
      <div className="project-card-header">
        <div className="project-info">
          <h3 className="project-name">{project.name}</h3>
          <div className="project-status">
            {getStatusIcon()}
            <span className={`status-label ${project.status}`}>
              {getStatusLabel()}
            </span>
          </div>
        </div>
        <div className="project-actions" onClick={(e) => e.stopPropagation()}>
          {project.status !== 'running' && (
            <button
              className="action-btn run-btn"
              onClick={() => onRun(project)}
              title="Run Project"
            >
              <Play size={16} />
            </button>
          )}
          <button
            className="action-btn edit-btn"
            onClick={() => onEdit(project)}
            title="Edit Project"
          >
            <Edit2 size={16} />
          </button>
          <button
            className="action-btn delete-btn"
            onClick={() => onDelete(project)}
            title="Delete Project"
          >
            <Trash2 size={16} />
          </button>
        </div>
      </div>

      {project.description && (
        <p className="project-description">{project.description}</p>
      )}

      <div className="project-stats">
        <div className="stat">
          <Users size={14} />
          <span>{project.teams.length} {project.teams.length === 1 ? 'Team' : 'Teams'}</span>
        </div>
        <div className="stat">
          <span className="agent-count">{totalAgents} Agents</span>
        </div>
        {project.executions && project.executions.length > 0 && (
          <div className="stat">
            <span className="execution-count">
              {project.executions.length} {project.executions.length === 1 ? 'Run' : 'Runs'}
            </span>
          </div>
        )}
      </div>

      <div className="project-footer">
        <span className="project-date">
          Updated {formatDate(project.updatedAt)}
        </span>
      </div>
    </div>
  );
};

export default ProjectCard;
